import classes from "./About.module.css";

const AboutPage = () => {
  return (
    <>
      <h2>About</h2>
      <p className={classes.about}>
        This is a website built with React js, Add items to cart or buy tickets.
        Thankyou!!!
      </p>
    </>
  );
};

export default AboutPage;
